        'a63ea923-3e5d-42f5-bf28-045fbccb4c7e',
        $$CREATE QUERY getFriendReviewsInArea(VERTEX<User> p, DOUBLE lat, DOUBLE lon) FOR GRAPH MyGraph {\n\tTYPEDEF tuple<STRING text, INT stars> review;\n\tSetAccum<review> @@reviews;\n\tSetAccum<VERTEX> @@F1F2;\n\tINT distKm = 30;\n\tusers = { User.* };\n\tPSet = { p };\n\tGrids = to_vertex_set(getNearbyGridId(distKm, lat, lon), "Geo_Grid");\n\tNearbyBusinesses =\n\t\tSELECT b\n\t\tFROM Grids:s-(Business_Geo:e)-Business:b\n\t\tWHERE geoDistance(lat, lon, e.LATITUDE, e.LONGITUDE) <= distKm;\n\tF1 =\n\t\tSELECT f\n\t\tFROM PSet-(Friends:fr)-User:f\n\t\tACCUM @@F1F2 += f;\n\tF2 =\n\t\tSELECT f\n\t\tFROM F1-(Friends:fr)-User:f\n\t\tACCUM @@F1F2 += f;\n\t@@F1F2.remove(p);\n\tFReviewedBusinesses =\n\t\tSELECT b\n\t\tFROM users:f-(Reviews)-Business:b\n\t\tWHERE @@F1F2.contains(f);\n\tNearbyFBusiness = NearbyBusinesses INTERSECT FReviewedBusinesses;\n\tGetTheReviews =\n\t\tSELECT b\n\t\tFROM NearbyFBusiness:b-(reverse_Reviews:tgt)-User:u\n\t\tWHERE MONTH(tgt.REVIEW_DATE) >= 11 AND MONTH(tgt.REVIEW_DATE) <= 12\n\t\tAND @@F1F2.contains(u)\n\t\tACCUM @@reviews += review(tgt.TEXT, tgt.STARS);\n\tPRINT @@reviews;\n}$$,
        'GSQL'
    );
